import React from 'react'
import styled from 'styled-components'
import Task from './Task.js';

const Taskbar = () => {
    return (
        <Container>
            <Task />
        </Container>
    )
}

export default Taskbar

const Container = styled.div`
    width: 50%;
    height: 100%;
    padding: 0;     
    margin: 0;
    background-color: blue;
`
